  \"2016-03-21T19:07:07.670366\",\n\t\"name\": \"methow-river-steelhead-methow-river-steelhead-hatchery-reform-research\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Steelhead in Pacific Northwest hatcheries
  are typically reared for release as 1-year-old smolts, rather than the 2and 3-year-old
  smolt life history patterns found in nature. High growth rates associated with accelerated
  hatchery rearing to a 1-year-old smolt life history may contribute to maladaptive
  behavioral traits and reduced post-release survival, and may constitute a primary
  mechanism leading to reduced fitness in hatchery fish. This project provides for
  implementation and evaluation of major hatchery reforms identified for the US Fish
  and Wildlife Services Winthrop National Fish Hatchery (WNFH).  The project combines
  hatchery-scale and laboratory scale research to investigate the effects of two growth
  regimes on i) post-release survival and behavior, ii) on maturation and residualism,
  iii) age-at-maturity, iv) epigenetic changes, and v) reproductive success of returning
  adults.nnLaboratory Data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
